        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (5, \'Accueil - Information étudiants\', \'Vous êtes étudiant à Université Côte d&rsquo;Azur ?\', \'<p>Un compte a d&eacute;j&agrave; &eacute;t&eacute; cr&eacute;&eacute; pour vous. Pour vous connecter et vous inscrire aux activit&eacute;s, munissez-vous simplement de votre adresse mail et du mot de passe utilis&eacute;s lors de votre inscription au campus universitaire. Apr&egrave;s vous &ecirc;tre acquitt&eacute; de la cotisation sportive annuelle, vous pourrez vous inscrire aux activit&eacute;s sportives propos&eacute;es par le campus, parmi une liste de 70 activit&eacute;s !</p>\r\n\r\n<p>&nbsp;</p>\', 0, NULL)');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (6, \'Accueil - Information externes\', \'Vous êtes ou avez été membre  de Université Côte d&rsquo;Azur et souhaitez vous inscrire aux activités ?\', NULL, 0, NULL)');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (11, \'Infos pratiques - 01\', \'INSCRIPTIONS AUX ACTIVITES\', \'<p>Pensez &agrave; VALIDER&nbsp;IMP&Eacute;RATIVEMENT VOTRE PANIER pour confirmer votre inscription aux activit&eacute;s.</p>\r\n\r\n<p>Pour les offres payantes, votre inscription sera finalis&eacute;e une fois le paiement effectu&eacute;.</p>\', 0, NULL)');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (12, \'Infos pratiques - 03\', \'Comment s&rsquo;inscrire\', \'<h3><strong>Vous &ecirc;tes &eacute;tudiant.e inscrit.e &agrave; Universit&eacute; C&ocirc;te d&#39;Azur ?</strong></h3>\r\n\r\n<p>Votre inscription p&eacute;dagogique est r&eacute;alis&eacute;e, vous pouvez vous inscrire aux activit&eacute;s propos&eacute;es par UCA Sport.<br />\r\nPour vous inscrire &agrave; nos activit&eacute;s vous devez vous connecter en utilisant vos identifiant et mot de passe de votre ENT.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Vous &ecirc;tes personnel d&#39;Universit&eacute; C&ocirc;te d&#39;Azur ?</strong></h3>\r\n\r\n<p>Vous &ecirc;tes personnel de l&rsquo;&eacute;tablissement, vous pouvez vous inscrire aux activit&eacute;s propos&eacute;es par UCA Sport.<br />\r\nPour vous inscrire &agrave; nos activit&eacute;s vous devez vous connecter en utilisant vos identifiant et mot de passe de votre ENT.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Vous &ecirc;tes Alumni, retrait&eacute;.e ou membre d&rsquo;honneur&nbsp;?</strong></h3>\r\n\r\n<p>Vous &ecirc;tes Alumni (ancien.ne &eacute;tudiant.e), retrait&eacute;.e de l&rsquo;&eacute;tablissement ou membre d&rsquo;honneur, vous devez demander la cr&eacute;ation d&rsquo;un compte via le formulaire de connexion en justifiant de votre statut. Une fois votre compt&eacute; cr&eacute;&eacute;, vous recevrez une confirmation par mail, vous pourrez alors b&eacute;n&eacute;ficier de trois activit&eacute;s maximum parmi une liste d&eacute;finie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3><strong>Vous &ecirc;tes &eacute;tudiant.e ou personnel&nbsp;CNRS, INSERM, INRA, INRIA, IRD, Villa Arson, ERACM, CIRM ?</strong></h3>\r\n\r\n<p>Vous devez demander la cr&eacute;ation d&rsquo;un compte via le formulaire de connexion en justifiant de votre statut. Vous pourrez ensuite&nbsp;vous inscrire aux activit&eacute;s propos&eacute;es par UCA Sport.<br />\r\n&nbsp;</p>\', 0, NULL)');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (13, \'Infos pratiques - 02\', \'CARTES BONUS SPORT\', \'<p><strong>Gagner des points ! En pratiquant une activit&eacute; sportive dans le cadre du Bonus Sport</strong></p>\r\n\r\n<p>Tous les &eacute;tudiants de L1 au M1/M2 ainsi que les &eacute;tudiants de l&#39;IUT et de Polytech Nice Sophia peuvent valider une bonification en Sport en pratiquant r&eacute;guli&egrave;rement une activit&eacute; propos&eacute;e par UCA SPORT.</p>\r\n\r\n<p>La carte de validation est valable pour un semestre. Renseignements et retrait dans le bureau des sports de votre campus (Ex.un &eacute;tudiant de Lettres prendra sa carte au Bureau des Sports de la fac de Lettres et la rendra dans ce m&ecirc;me bureau......).</p>\r\n\r\n<p>&nbsp;<strong>Rappel pour les &eacute;tudiants qui peuvent prendre l&#39;UEL Sport dans leur cursus: vous ne pouvez cumuler le Bonus Sport avec l&#39;UEL &quot;Sport&quot;.</strong></p>\', 0, \'<p><strong>Gagner des points ! En pratiquant une activit&eacute; sportive dans le cadre du Bonus Sport</strong></p>\r\n\r\n<p>Tous les &eacute;tudiants de L1 au M1/M2 ainsi que les &eacute;tudiants de l&#39;IUT et de Polytech Nice Sophia peuvent valider une bonification en Sport en pratiquant r&eacute;guli&egrave;rement une activit&eacute; propos&eacute;e par UCA SPORT.</p>\r\n\r\n<p>La carte de validation est valable pour un semestre. Renseignements et retrait dans le bureau des sports de votre campus (Ex.un &eacute;tudiant de Lettres prendra sa carte au Bureau des Sports de la fac de Lettres et la rendra dans ce m&ecirc;me bureau......).</p>\r\n\r\n<p>&nbsp;<strong>Rappel pour les &eacute;tudiants qui peuvent prendre l&#39;UEL Sport dans leur cursus: vous ne pouvez cumuler le Bonus Sport avec l&#39;UEL &quot;Sport&quot;.</strong></p>\')');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (14, \'Mentions légales\', \'Mentions légales\', \'<h2><strong>Propri&eacute;t&eacute; intellectuelle</strong></h2>\r\n\r\n<p>L&rsquo;ensemble des contenus de ce site Internet rel&egrave;ve de la l&eacute;gislation fran&ccedil;aise et internationale sur la propri&eacute;t&eacute; intellectuelle. Les textes, images, photographies, s&eacute;quences sonores et vid&eacute;os publi&eacute;s sur le site sont prot&eacute;g&eacute;s par les droits de propri&eacute;t&eacute; intellectuelle et sont la propri&eacute;t&eacute; de UCA SPORT.</p>\r\n\r\n<h2><strong>Reproduction</strong></h2>\r\n\r\n<p>Toute reproduction &agrave; des fins publicitaires ou commerciale est exclue.<br />\r\nLa reproduction, sur un support papier ou informatique, de tout ou partie du site est autoris&eacute;e sous r&eacute;serve qu&rsquo;elle soit strictement r&eacute;serv&eacute;e &agrave; un usage personnel, et qu&rsquo;elle soit conforme aux dispositions de l&rsquo;article L122-5 du Code de la Propri&eacute;t&eacute; Intellectuelle.<br />\r\nLa reproduction sur support &eacute;lectronique de tout ou partie du site est autoris&eacute;e, sous r&eacute;serve de la mention &laquo;&nbsp;droits r&eacute;serv&eacute;s&nbsp;&raquo; et de l&rsquo;ajout de la source (sport.univ-cotedazur.fr). Toutefois, cette autorisation ne s&rsquo;applique pas &agrave; des sites &agrave; caract&egrave;re pornographique, x&eacute;nophobe et pol&eacute;mique, ou aux m&oelig;urs pouvant porter atteintes &agrave; la sensibilit&eacute; du plus grand nombre.<br />\r\nLa reproduction sur support papier de tout ou partie du site est autoris&eacute;e, sous r&eacute;serve de respecter l&rsquo;int&eacute;grit&eacute; des donn&eacute;es reproduites (ni alt&eacute;ration, ni modification), de rendre gratuit la diffusion et de citer explicitement le site <a href=\"http://www.univ-cotedazur.fr/\">sport.univ-cotedazur.fr</a> comme source, en mentionnant que les droits de reproductions sont r&eacute;serv&eacute;s et limit&eacute;s.<br />\r\nLa violation de l&rsquo;un de ces droits d&rsquo;exploitation repr&eacute;sente un d&eacute;lit de contrefa&ccedil;on pouvant engager la responsabilit&eacute; civile et p&eacute;nale du contrefacteur.&nbsp;</p>\r\n\r\n<h2><strong>Liens hypertextes</strong></h2>\r\n\r\n<p>Le site UCA SPORT autorise tout autre site internet ou support digital &agrave; le citer ou &agrave; mettre en place un lien hypertexte pointant sur sa page d&rsquo;accueil ou l&rsquo;une des pages du site (sport.univ-cotedazur.fr), sous r&eacute;serve que l&rsquo;acc&egrave;s aux pages contenant ces liens vers le portail UCA SPORT soit gratuit et que les documents reproduits soient respect&eacute;s dans leurs int&eacute;gralit&eacute;s.<br />\r\nUCA SPORT se r&eacute;serve le droit de demander la suppression d&rsquo;un lien qu&rsquo;elle estime non conforme &agrave; sa ligne &eacute;ditoriale.<br />\r\nDans la mesure o&ugrave; UCA SPORT ne peut contr&ocirc;ler ces sites et ces sources externes, l&#39;existence de tels liens hypertextes entre le site <a href=\"http://www.univ-cotedazur.fr/\">sport.univ-cotedazur.fr</a> et des sites tiers ne signifie pas que UCA SPORT assume une quelconque responsabilit&eacute; quant &agrave; son contenu ou &agrave; l&#39;usage qui peut en &ecirc;tre fait.</p>\r\n\r\n<h2><strong>Cookies</strong></h2>\r\n\r\n<p>Lors des visites de l&rsquo;internaute sur le site, des cookies peuvent s&rsquo;installer automatiquement et &ecirc;tre enregistr&eacute;s temporairement dans la m&eacute;moire du disque dur.<br />\r\n- le portail cr&eacute;e des cookies pour les visiteurs afin d&#39;optimiser les performances du serveur la vitesse de navigation,<br />\r\n- le portail cr&eacute;e des cookies sp&eacute;cifiques aux personnes authentifi&eacute;es,<br />\r\n- l&#39;utilisation de services tiers (analytics, r&eacute;seaux sociaux, plateformes vid&eacute;os...) entrainent la cr&eacute;ation de cookies ind&eacute;pendants du portail.</p>\r\n\r\n<p>Les cookies ne permettent pas d&rsquo;identifier l&rsquo;utilisateur mais servent &agrave; faciliter la navigation sur le site et les proc&eacute;dures d&rsquo;enregistrement ou les mesures d&rsquo;audience.<br />\r\nL&rsquo;utilisateur du site peut toutefois d&eacute;sactiver l&rsquo;installation de cookies en modifiant les param&egrave;tres de son logiciel de navigation.</p>\r\n\r\n<h2><strong>Protection des donn&eacute;es personnelles</strong></h2>\r\n\r\n<p>En vertu des obligations l&eacute;gales relatives &agrave; la loi du 6 ao&ucirc;t 2004 sur la protection des personnes physiques &agrave; l&rsquo;&eacute;gard des traitements de donn&eacute;es &agrave; caract&egrave;re personnel, les informations personnelles sont strictement confidentielles et ne peuvent &ecirc;tre c&eacute;d&eacute;es &agrave; des tiers &agrave; l&rsquo;insu de l&rsquo;utilisateur. Les donn&eacute;es c&eacute;d&eacute;es sur le site, notamment via le formulaire de contact ou pour la newsletter, ne sont ni divulgu&eacute;es ni utilis&eacute;es &agrave; des fins non pr&eacute;vues par l&rsquo;utilisateur du site.</p>\r\n\r\n<h2><strong>Direction de la publication&nbsp;</strong></h2>\r\n\r\n<p>Jeanick Brisswalter, Pr&eacute;sident de l&rsquo;Universit&eacute; C&ocirc;te d&rsquo;Azur.</p>\r\n\r\n<h2><strong>Conception</strong></h2>\r\n\r\n<p>Direction de la Vie Universitaire</p>\r\n\r\n<p>Direction des Syst&egrave;mes d&#39;information&nbsp;</p>\r\n\r\n<p>Universit&eacute; C&ocirc;te d&rsquo;Azur</p>\', 0, NULL)');
