        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (19, \'Données Personnelles\', \'Données personnelles\', \'<h2>Finalit&eacute;s du traitement</h2>\r\n\r\n<p>Proposer et promouvoir &agrave; l&#39;ensemble des &eacute;tudiants et des personnels de l&#39;Universit&eacute; C&ocirc;te d&#39;Azur ainsi qu&#39;&agrave; ses partenaires, sous forme d&#39;application Web et mobile, un ensemble d&#39;activit&eacute;s physiques et sportives propos&eacute; par le service des sports universitaire avec notamment :</p>\r\n\r\n<ul>\r\n	<li>L&#39;inscription &agrave; des activit&eacute;s physiques et sportives, r&eacute;servation de ressources d&eacute;di&eacute;es</li>\r\n	<li>La facturation et paiement des activit&eacute;s et r&eacute;servations sp&eacute;cifiques</li>\r\n	<li>La promotion des &eacute;v&egrave;nements sportifs</li>\r\n</ul>\r\n\r\n<h2>Lic&eacute;it&eacute; du traitement</h2>\r\n\r\n<p>Le pr&eacute;sent traitement est bas&eacute; sur</p>\r\n\r\n<ul>\r\n	<li>L&lsquo;ex&eacute;cution d&rsquo;une mission de service public avec acceptation des conditions g&eacute;n&eacute;rales du service par les personnes concern&eacute;es.</li>\r\n	<li>L&rsquo;ex&eacute;cution d&#39;un contrat pour les prestations payantes int&eacute;grant les obligations comptables pour les &eacute;l&eacute;ments de facturation</li>\r\n</ul>\r\n\r\n<h2>Dur&eacute;e de conservation des donn&eacute;es</h2>\r\n\r\n<p>Une ann&eacute;e universitaire soit 12 mois au plus.</p>\r\n\r\n<p>Archivage des donn&eacute;es comptables (min 5 ans)</p>\r\n\r\n<h2>Destinataire des donn&eacute;es</h2>\r\n\r\n<p>Direction de la vie Universitaire/Service des sports universitaire</p>\r\n\r\n<h2>Transferts de donn&eacute;es</h2>\r\n\r\n<p>Aucun autre transfert de donn&eacute;es n&rsquo;est r&eacute;alis&eacute; au titre du pr&eacute;sent traitement, l&rsquo;ensemble des donn&eacute;es &agrave; caract&egrave;re personnel est trait&eacute; sur les plateformes techniques, en propre, pour l&rsquo;&eacute;tablissement.</p>\r\n\r\n<h2>Responsable du traitement</h2>\r\n\r\n<p>Universit&eacute; Cote d&rsquo;Azur</p>\r\n\r\n<p>28, avenue de Valrose</p>\r\n\r\n<p>06100 NICE</p>\r\n\r\n<p><a href=\"mailto:presidence@univ.cotedazur.fr\">presidence@univ.cotedazur.fr</a></p>\r\n\r\n<h2>D&eacute;l&eacute;gu&eacute; &agrave; la Protection des Donn&eacute;es</h2>\r\n\r\n<p>Contact&nbsp;: <a href=\"mailto:dpo@univ-cotedazur.fr\">dpo@univ-cotedazur.fr</a></p>\r\n\r\n<h2>Vos droits&nbsp;:</h2>\r\n\r\n<p>Les donn&eacute;es relatives aux inscriptions, r&eacute;servations et paiement s&rsquo;inscrivant dans une mission de service public, conform&eacute;ment au r&egrave;glement g&eacute;n&eacute;ral sur la protection des donn&eacute;es (UE) 2016/679 ainsi qu&rsquo;&agrave; la loi informatique et libert&eacute; 78/17 modifi&eacute;e vous b&eacute;n&eacute;ficiez des droits suivants&nbsp;:</p>\r\n\r\n<ul>\r\n	<li>Droit d&rsquo;acc&egrave;s</li>\r\n	<li>Droit de rectification</li>\r\n	<li>Droit &agrave; la limitation de ce traitement</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Afin de demander l&rsquo;exercice de vos droits, vous pouvez formuler une demande aupr&egrave;s du service responsable du traitement &agrave; l&rsquo;adresse suivante&nbsp;:</p>\r\n\r\n<p><a href=\"https://glpi.unice.fr/plugins/formcreator/front/formdisplay.php?id=117\">https://glpi.unice.fr/plugins/formcreator/front/formdisplay.php?id=117</a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dans cette demande, vous pr&eacute;ciserez vos noms, pr&eacute;nom, adresse email (assortis d&rsquo;une preuve d&rsquo;identit&eacute;), ainsi que la nature du ou des droits que vous souhaitez exercer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Introduction d&rsquo;une r&eacute;clamation</h2>\r\n\r\n<p>Nous mettons tout en &oelig;uvre pour le respect de la RGPD afin de garantir la s&eacute;curit&eacute; et vos droits concernant vos donn&eacute;es &agrave; caract&egrave;re personnel.</p>\r\n\r\n<p>N&eacute;anmoins, dans l&rsquo;&eacute;ventualit&eacute; o&ugrave; vous constateriez un manquement par rapport &agrave; cette r&eacute;glementation, vous &ecirc;tes en droit d&rsquo;introduire une r&eacute;clamation aupr&egrave;s de l&rsquo;autorit&eacute; de contr&ocirc;le&nbsp;: Commission Nationale de l&rsquo;Informatique et des Libert&eacute;s, 3, Place de Fontenoy - TSA 80715 - 75334 PARIS CEDEX 07. T&eacute;l : 01 53 73 22 22</p>\', 0, NULL)');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (20, \'CGV\', \'Conditions générales de vente\', \'<p><strong>Article 1 - G&eacute;n&eacute;ralit&eacute;s</strong></p>\r\n\r\n<p>Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont conclues entre :<br />\r\n&nbsp;<br />\r\nD&rsquo;une part, la Communaut&eacute; d&rsquo;Universit&eacute; C&ocirc;te d&rsquo;Azur, &eacute;tablissement public &agrave; caract&egrave;re scientifique, culturel et professionnel, dont le si&egrave;ge social est situ&eacute; &agrave; NICE (06103 &ndash; Cedex 2), Grand Ch&acirc;teau, 28 avenue Valrose, B.P. 2135, &nbsp;<br />\r\n&nbsp;<br />\r\nN&deg; SIREN : 130 020 894&nbsp; N&deg; SIRET : 130 020 894 00015<br />\r\n&nbsp;<br />\r\nCi-apr&egrave;s d&eacute;nomm&eacute;e &laquo; COMUE UCA &raquo;, &nbsp;<br />\r\n&nbsp;<br />\r\nD&rsquo;autre part, toute personne souhaitant proc&eacute;der &agrave; un achat ou une r&eacute;servation sur le site internet &laquo; UCA SPORT &raquo; (adresse : https://sport.univ-cotedazur.fr), &nbsp;<br />\r\n&nbsp;<br />\r\nCi-apr&egrave;s d&eacute;nomm&eacute;e &laquo; l&rsquo;adh&eacute;rent &raquo;.<br />\r\n&nbsp;<br />\r\nTout adh&eacute;rent peut prendre connaissance &agrave; tout moment des conditions g&eacute;n&eacute;rales de vente sur le site.&nbsp;&nbsp; Les pr&eacute;sentes conditions g&eacute;n&eacute;rales r&eacute;gissent la vente de toute prestation de service (activit&eacute;s, &eacute;v&egrave;nements) ou r&eacute;servation de bien (local/installation sportive ou mat&eacute;riel) pr&eacute;sent&eacute;es sur le site de &laquo; UCA SPORT &raquo; (adresse : https://sport.univ-cotedazur.fr).&nbsp; Toute achat d&rsquo;une prestation de service ou r&eacute;servation d&rsquo;un bien par le biais dudit site implique une acceptation sans r&eacute;serve par l&rsquo;adh&eacute;rent des pr&eacute;sentes conditions de vente, et des conditions particuli&egrave;res ou sp&eacute;cifiques &eacute;ventuellement applicables &agrave; une ou plusieurs commandes. La COMUE UCA se r&eacute;serve le droit de modifier les conditions g&eacute;n&eacute;rales de vente &agrave; tout moment.&nbsp; Les conditions de vente applicables sont celles en vigueur sur le site &agrave; la date de la validation de commande (voir l&rsquo;article 9 des pr&eacute;sentes conditions g&eacute;n&eacute;rales). &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 2 - Inscription &nbsp;</strong></p>\r\n\r\n<p>Les &eacute;tudiants et personnels de l&rsquo;&eacute;tablissement, les membres d&rsquo;honneur, les alumnis et les retrait&eacute;s de l&rsquo;&eacute;tablissement, les personnels des &eacute;tablissements partenaires d&eacute;finis sur le site et conformes &agrave; la d&eacute;lib&eacute;ration en vigueur dans l&rsquo;&eacute;tablissement, sont les seules personnes autoris&eacute;es &agrave; r&eacute;aliser des transactions sur le site mobile &laquo; UCA Sport&raquo;.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 3 - Types de services </strong></p>\r\n\r\n<p><strong>Article -3.1. Les caract&eacute;ristiques des services et biens propos&eacute;s &agrave; la vente/r&eacute;servation Les biens et services propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation sont :</strong></p>\r\n\r\n<p>- Le paiement de cotisations sportives pour les membres du personnel ;</p>\r\n\r\n<p>- Des activit&eacute;s physiques et sportives ;&nbsp;</p>\r\n\r\n<p>- Des cartes d&rsquo;activit&eacute;s (tennis, musculation et tennis + musculation) ;</p>\r\n\r\n<p>- Des &eacute;v&egrave;nements ;</p>\r\n\r\n<p>- Des locaux/installations sportives (uniquement en r&eacute;servation)</p>\r\n\r\n<p>- Du mat&eacute;riel sportif (uniquement en r&eacute;servation)&nbsp;</p>\r\n\r\n<p>L&rsquo;ensemble de ces services et biens sont d&eacute;crits et pr&eacute;sent&eacute;s avec la plus grande exactitude possible sur le site de &laquo; UCA Sport &raquo;. Les photos et illustrations sont communiqu&eacute;es au titre de descriptions imag&eacute;es des activit&eacute;s, &eacute;v&eacute;nements, espaces ou mat&eacute;riels &agrave; l&#39;appui du texte n&rsquo;ont aucune valeur contractuelle.<br />\r\n&nbsp;<br />\r\n<strong>Article - 3.2. La disponibilit&eacute; des activit&eacute;s, &eacute;v&eacute;nements, espaces ou mat&eacute;riel propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation </strong></p>\r\n\r\n<p>Les activit&eacute;s, &eacute;v&eacute;nements, locaux ou mat&eacute;riels propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation sur le site de &laquo; UCA SPORT &raquo; sont disponibles dans la limite des capacit&eacute;s d&rsquo;accueil, de la disponibilit&eacute; du mat&eacute;riel et des locaux.&nbsp; La disponibilit&eacute; ainsi que les capacit&eacute;s d&rsquo;accueil des biens et services propos&eacute;s &agrave; la vente sont pr&eacute;cis&eacute;es sur le site internet, sur chaque descriptif d&rsquo;activit&eacute;, d&rsquo;&eacute;v&egrave;nement, de local/installation ou de mat&eacute;riel.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>Article 4 - Vente &agrave; distance et droit de r&eacute;tractation</strong></p>\r\n\r\n<p>Aux termes des articles L221-16 du code de la consommation, vous disposer d&rsquo;un droit de r&eacute;tractation applicable &agrave; votre souscription, sans motivation, dans les quatorze (14) jours francs &agrave; compter du jour de l&rsquo;inscription. Si le quatorzi&egrave;me (14e) jour tombe un week-end ou un jour f&eacute;ri&eacute;, le droit de r&eacute;tractation expirera &agrave; la fin du premier jour ouvrable suivant. Ce droit de r&eacute;tractation ne s&rsquo;applique que pour les adh&eacute;rents ayant r&eacute;gl&eacute; leur adh&eacute;sion sur le site internet UCA Sport (adresse : https://sport.univ-cotedazur.fr).&nbsp; Si vous d&eacute;cidez de faire usage de votre droit de r&eacute;tractation et que le service, objet de votre achat, n&rsquo;a pas &eacute;t&eacute; utilis&eacute; pendant cette p&eacute;riode de quatorze (14) jours, le remboursement de la cotisation sera int&eacute;gral. Si des services ont &eacute;t&eacute; utilis&eacute; pendant cette p&eacute;riode de quatorze (14) jours, UCA peut se r&eacute;server la possibilit&eacute; de conserver une partie du montant de l&rsquo;adh&eacute;sion vers&eacute;e au prorata du nombre de fois o&ugrave; les prestations de service auront &eacute;t&eacute; utilis&eacute; (&agrave; savoir &agrave; partir de l&rsquo;activation de l&rsquo;adh&eacute;sion jusqu&rsquo;au jour de l&rsquo;annulation, y compris les &eacute;ventuels frais d&rsquo;inscription). Le montant du remboursement sera effectu&eacute; sur le m&ecirc;me moyen de paiement. UCA s&rsquo;engage &agrave; rembourser l&rsquo;adh&eacute;rent dans un d&eacute;lai d&rsquo;un mois.<br />\r\n&nbsp;<br />\r\nPour vous r&eacute;tracter, vous devez envoyer un message par le biais de l&rsquo;onglet contact situ&eacute; sur le site de &laquo; UCA Sport &raquo; en mentionnant les informations ci-dessous : Je vous notifie par la pr&eacute;sente ma d&eacute;cision de r&eacute;tractation du contrat portant sur la prestation de service suivante :</p>\r\n\r\n<p>Souscris-le :</p>\r\n\r\n<p>Nom du (des) souscripteur(s) :</p>\r\n\r\n<p>Date de naissance du ou (des) souscripteur(s)</p>\r\n\r\n<p>Adresse du (des) souscripteur(s) :</p>\r\n\r\n<p>Date :<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 5 - Attestation/Certificat m&eacute;dical</strong></p>\r\n\r\n<p>Il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de produire un certificat m&eacute;dical arguant d&rsquo;une bonne capacit&eacute; physique. L&rsquo;adh&eacute;rent d&eacute;clare que son &eacute;tat de sant&eacute; lui permet de pratiquer les activit&eacute;s sportives propos&eacute;es par &laquo; UCA Sport &raquo; et plus particuli&egrave;rement d&rsquo;utiliser les services, locaux/installations et mat&eacute;riels sportifs apr&egrave;s avoir pris connaissance des consignes de s&eacute;curit&eacute;, d&rsquo;hygi&egrave;ne et d&rsquo;utilisation. Par ailleurs, l&rsquo;adh&eacute;rent d&eacute;clare qu&rsquo;il ne souffre d&rsquo;aucune maladie cardiaque, respiratoire notamment et/ou d&rsquo;aucune blessure ou inaptitude physique de nature &agrave; l&rsquo;emp&ecirc;cher de pratiquer les activit&eacute;s et services objets des pr&eacute;sentes Conditions G&eacute;n&eacute;rales de Ventes. L&rsquo;adh&eacute;rent sujet aux crises d&rsquo;&eacute;pilepsie ou autres pathologies susceptibles de complexifier l&rsquo;intervention des &eacute;quipes m&eacute;dicales et sauveteurs doit en informer express&eacute;ment &laquo; UCA Sport &raquo;. L&rsquo;adh&eacute;rent d&eacute;clare avoir &eacute;t&eacute; inform&eacute; et conna&icirc;tre les risques li&eacute;s &agrave; la pratique des activit&eacute;s sportives propos&eacute;es.&nbsp; En tout &eacute;tat de cause, &laquo; UCA Sport &raquo; n&rsquo;est pas exon&eacute;r&eacute;e de ses obligations d&rsquo;information et de conseil.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 6 - Tarifs</strong></p>\r\n\r\n<p>Les prix affich&eacute;s sur le site de &laquo; UCA Sport &raquo; sont indiqu&eacute;s en euros (&euro;), toutes taxes comprises (TTC). L&rsquo;COMUE UCAse r&eacute;serve le droit de modifier les prix &agrave; tout moment, &eacute;tant entendu que le tarif, affich&eacute; sur le site internet, le jour de l&rsquo;achat ou de la r&eacute;servation sera le seul applicable a l&rsquo;adh&eacute;rent. La validation de son achat par l&rsquo;adh&eacute;rent vaut acceptation pleine et enti&egrave;re de la tarification appliqu&eacute;e &agrave; l&rsquo;offre concern&eacute;e. Le paiement de la totalit&eacute; du prix doit &ecirc;tre r&eacute;alis&eacute; lors de la commande en ligne du service. L&rsquo;adh&eacute;rent ne pourra jouir des biens ou services propos&eacute;s que lorsque le paiement complet du prix aura &eacute;t&eacute; per&ccedil;u par l&rsquo;Universit&eacute;.<br />\r\n<strong>&nbsp;<br />\r\nArticle 6.1 - L&rsquo;adh&eacute;sion &agrave; &laquo; UCA Sport &raquo;</strong></p>\r\n\r\n<p>Les &eacute;tudiants inscrits en formation initiale dans l&rsquo;enseignement sup&eacute;rieur acquittent pr&eacute;alablement &agrave; leur inscription, la contribution vie &eacute;tudiante et de campus (CVEC) d&rsquo;un montant de 90 &euro;. Les &eacute;tudiants boursiers sont exon&eacute;r&eacute;s de cette contribution. Tous les &eacute;tudiants inscrits en formation initiale ont ainsi acc&egrave;s &agrave; des services de vie &eacute;tudiante dont l&rsquo;offre sportive et ce gratuitement une fois le paiement de la CVEC confirm&eacute;e (pr&eacute;alable &agrave; l&rsquo;inscription dans l&rsquo;&eacute;tablissement). UCA permet &agrave; d&rsquo;autres publics que les &eacute;tudiants en formation initiale d&rsquo;acc&eacute;der &agrave; l&rsquo;offre sportive, selon les modalit&eacute;s d&eacute;crites ci-dessous. Les diff&eacute;rents types d&rsquo;adh&eacute;sion (CVEC, cartes d&rsquo;adh&eacute;sions), permettent l&rsquo;acc&egrave;s &agrave; un bouquet d&rsquo;activit&eacute;s dans la limite des places disponibles, en sports individuels et collectifs comprenant des activit&eacute;s de pleine nature, aquatique, de montagne ou encore de glisse, des sports collectifs en salle et ext&eacute;rieurs organis&eacute;s et encadr&eacute;s par des professionnels.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Public</strong></td>\r\n			<td><strong>Type de droit</strong></td>\r\n			<td><strong>Tarif</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Etudiants UCA</td>\r\n			<td><br />\r\n			Carte sport</td>\r\n			<td><br />\r\n			90&euro; pay&eacute; lors de l&rsquo;inscription (CVEC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Personnels UNS / UCA</td>\r\n			<td><br />\r\n			Carte sport</td>\r\n			<td>60 &euro;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Membres d&rsquo;honneur*, retrait&eacute;s, alumnis de l&rsquo;&eacute;tablissement et Auditeurs libres</td>\r\n			<td>Carte 3 activit&eacute;s sur liste d&eacute;fini</td>\r\n			<td>150 &euro;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Partenaires</td>\r\n			<td>Public non prioritaires</td>\r\n			<td>105 &euro;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*Membre d&rsquo;honneur : Personnes dont l&rsquo;&eacute;tablissement reconna&icirc;t le lien particulier avec le service des sports via un vote en Conseil des Sports *Partenaires : Personnels de l&rsquo;OCA et des EPST partenaires de l&rsquo;UNS (CNRS, INSERM, INRA, INRIA, IRD)</p>\r\n\r\n<p><strong>Article 6.2 - Les activit&eacute;s optionnelles payantes </strong></p>\r\n\r\n<p>&laquo; UCA Sport &raquo; propose &agrave; l&rsquo;ensemble des adh&eacute;rents sans distinction d&rsquo;affiliation des activit&eacute;s optionnels payantes, certaines pouvant faire l&rsquo;objet d&rsquo;un droit de priorit&eacute;s pour les &eacute;tudiants. Ces derni&egrave;res sont nomm&eacute;es et leurs tarifs d&eacute;velopp&eacute;s sur le site et en annexe des pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 7 &ndash; La Carte</strong></p>\r\n\r\n<p>La Carte &eacute;tudiante/personnel/autres personnes autoris&eacute;es est une carte d&rsquo;acc&egrave;s que l&rsquo;adh&eacute;rent doit obligatoirement avoir sur lui. Elle est nominative et incessible. Elle est valable pour toute la dur&eacute;e de l&rsquo;adh&eacute;sion, sauf en cas de perte ou d&eacute;t&eacute;rioration, o&ugrave; elle sera remplac&eacute;e aux frais de l&rsquo;adh&eacute;rent. Il est obligatoire de pr&eacute;senter la Carte. En cas de non-pr&eacute;sentation de la Carte, l&rsquo;acc&egrave;s &agrave; l&rsquo;activit&eacute;, &agrave; l&rsquo;&eacute;v&egrave;nement, au local ou au mat&eacute;riel pourra &ecirc;tre refus&eacute;.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 8 - Libre acc&egrave;s aux installations</strong></p>\r\n\r\n<p>Les adh&eacute;rents peuvent sur pr&eacute;sentation de leur carte &eacute;tudiant/personnel/autres personnes autoris&eacute;es, en cours de validit&eacute;, b&eacute;n&eacute;ficier de l&rsquo;acc&egrave;s aux diff&eacute;rentes activit&eacute;s sur l&rsquo;ensemble des campus et b&acirc;timents de UCA. Pour acc&eacute;der aux activit&eacute;s, ils devront avoir proc&eacute;der &agrave; la r&eacute;servation, sur le site internet, d&eacute;crite dans l&rsquo;article ci-apr&egrave;s. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 9 - Modalit&eacute;s d&rsquo;inscription</strong></p>\r\n\r\n<p><strong>Article - 9.1. La commande</strong></p>\r\n\r\n<p>La commande est l&rsquo;ensemble des actes r&eacute;alis&eacute;s de s&eacute;lection, de validation du panier et de paiement, mis en &oelig;uvre par tout adh&eacute;rent, pour un usage exclusivement personnel sur le site internet.<br />\r\n&nbsp;<br />\r\n<strong>Article - 9.1.1. Les modalit&eacute;s de passation de la commande</strong></p>\r\n\r\n<p>Il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de passer commande aupr&egrave;s de la COMUE UCA en ligne sur le site internet ou via l&rsquo;application &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr). En cas d&rsquo;impossibilit&eacute; il est &eacute;galement possible de payer en esp&egrave;ces ou par ch&egrave;que aupr&egrave;s d&rsquo;un bureau des sports. Aucune commande adress&eacute;e &agrave; la COMUE UCA par courrier ou par fax ne sera prise en compte.&nbsp; L&rsquo;adh&eacute;rent int&eacute;ress&eacute; par une activit&eacute;, un &eacute;v&eacute;nement, un local/installation sportive ou du mat&eacute;riel sportif visible sur le site &laquo; UCA Sport &raquo; suit le processus suivant afin d&#39;&eacute;tablir sa commande.</p>\r\n\r\n<p>PREMIERE ETAPE :&nbsp;</p>\r\n\r\n<p>Toute commande aupr&egrave;s de la COMUE UCA n&eacute;cessite d&rsquo;abord la cr&eacute;ation d&rsquo;un Compte d&rsquo;Adh&eacute;rent sur le site d&rsquo;&laquo;UCA Sport &raquo;.&nbsp; L&rsquo;acc&egrave;s &agrave; ce Compte Adh&eacute;rent est autoris&eacute; :<br />\r\n&nbsp;<br />\r\n- Soit par le statut d&rsquo;adh&eacute;rent (&eacute;tudiants, personnels, personnels des &eacute;tablissements partenaires, et accessible directement via les identifiants de connexion de l&rsquo;&eacute;tablissement de rattachement),&nbsp; - Soit par la demande de cr&eacute;ation d&rsquo;un compte aupr&egrave;s des administrateurs &laquo; UCA Sport &raquo; qui sera ou non valid&eacute;e de mani&egrave;re discr&eacute;tionnaire pour les alumnis, les retrait&eacute;s de l&rsquo;&eacute;tablissement et les membres d&rsquo;honneur*. *voir article 6.1<br />\r\n&nbsp;<br />\r\nL&rsquo;adh&eacute;rent s&rsquo;engage &agrave; ne pas communiquer les identifiants de son Compte &agrave; des tiers. La COMUE UCA ne saurait &ecirc;tre tenue pour responsable de toute action r&eacute;alis&eacute;e via ou sur un Compte Adh&eacute;rent par un tiers auquel l&rsquo;adh&eacute;rent aurait communiqu&eacute; ses identifiants, ou bien qui aurait eu acc&egrave;s aux identifiants ou au Compte Adh&eacute;rent suite &agrave; une faute ou une n&eacute;gligence imputable audit adh&eacute;rent.</p>\r\n\r\n<p>DEUXIEME ETAPE :</p>\r\n\r\n<p>Apr&egrave;s avoir s&eacute;lectionn&eacute; un panier de commande, l&rsquo;adh&eacute;rent doit contr&ocirc;ler (par exemple : identification et quantit&eacute; d&rsquo;activit&eacute;s s&eacute;lectionn&eacute;es, prix correspondants) et &eacute;ventuellement corriger le contenu du panier, avant de le valider.</p>\r\n\r\n<p>TROISIEME ETAPE :&nbsp;</p>\r\n\r\n<p>L&rsquo;adh&eacute;rent doit effectuer le paiement dans les conditions pr&eacute;vues aux pr&eacute;sentes conditions g&eacute;n&eacute;rales.</p>\r\n\r\n<p><strong>Article - 9.1.2. L&rsquo;enregistrement de la commande </strong></p>\r\n\r\n<p>Suite au paiement de la commande, la COMUE UCA accuse r&eacute;ception aupr&egrave;s de l&rsquo;adh&eacute;rent de l&rsquo;acceptation du paiement, en lui mettant &agrave; disposition une facture contenant les r&eacute;f&eacute;rences de la commande ainsi que le r&eacute;capitulatif d&eacute;taill&eacute; (num&eacute;ro, date, mode de paiement, activit&eacute;s achet&eacute;es) dans les param&egrave;tres de son compte adh&eacute;rent.</p>\r\n\r\n<p><strong>Article - 9.2. Dispositions g&eacute;n&eacute;rales&nbsp;</strong></p>\r\n\r\n<p>L&rsquo;ensemble des donn&eacute;es fournies et la commande enregistr&eacute;e valent preuve de la transaction. La confirmation vaut signature et acceptation de la commande par le l&rsquo;adh&eacute;rent. La validation de la commande vaut, dans tous les cas, signature et acceptation de toutes les op&eacute;rations effectu&eacute;es sur le site.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>Article - 10 Modalit&eacute;s de paiement </strong></p>\r\n\r\n<p><strong>Article - 10.1. Le paiement de la commande</strong></p>\r\n\r\n<p>Le paiement des commandes individuelles s&rsquo;effectue &agrave; chaque fois que cela est possible en ligne &agrave; partir du site internet &laquo; UCA Sport &raquo;, par carte bancaire. En cas d&rsquo;impossibilit&eacute;, le paiement en bureau des sports est possible en ch&egrave;que ou esp&egrave;ces. L&rsquo;adh&eacute;rent fournit les donn&eacute;es confidentielles li&eacute;es &agrave; son moyen de paiement (num&eacute;ro de carte bancaire, date d&rsquo;expiration et cryptogramme). Il valide finalement sa commande en cliquant sur le bouton &quot;Valider&quot;. Cette validation vaut vente et engage irr&eacute;vocablement les parties.<br />\r\n&nbsp;<br />\r\n<strong>Article - 10.2. La s&eacute;curisation des paiements</strong></p>\r\n\r\n<p>Les paiements effectu&eacute;s &agrave; partir du site internet &laquo; UCA Sport &raquo; sont enti&egrave;rement s&eacute;curis&eacute;s. La COMUE UCA recourt &agrave; la plateforme de paiement s&eacute;curis&eacute; Paybox&reg;, qui garantit l&rsquo;utilisation du proc&eacute;d&eacute; de cryptage SSL (Secure Socket Layer) pour prot&eacute;ger toutes les donn&eacute;es confidentielles li&eacute;es aux moyens de paiement (num&eacute;ro de carte bancaire, date d&rsquo;expiration et cryptogramme), communiqu&eacute;es par l&rsquo;adh&eacute;rent lors de sa commande.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 11 Annulation de l&rsquo;inscription&nbsp; </strong></p>\r\n\r\n<p><strong>Article - 11.1. L&rsquo;annulation des commandes par l&rsquo;adh&eacute;rent </strong></p>\r\n\r\n<p>L&rsquo;annulation des commandes par l&rsquo;adh&eacute;rent se fait en se d&eacute;sinscrivant de l&rsquo;activit&eacute; via le site.&nbsp; Dans le cas d&rsquo;activit&eacute;s ou d&rsquo;&eacute;v&eacute;nements payants, il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de pr&eacute;venir l&rsquo;encadrant de l&rsquo;activit&eacute; ou de l&rsquo;&eacute;v&eacute;nement par mail dans les meilleurs d&eacute;lais. L&rsquo;adh&eacute;rent s&rsquo;assure de remplir tous les crit&egrave;res pour participer &agrave; une activit&eacute; avant son paiement. Aucune annulation du fait du de l&rsquo;adh&eacute;rent ne donne droit &agrave; un quelconque remboursement de la part de l&rsquo;Universit&eacute;.&nbsp;&nbsp;</p>\r\n\r\n<p><strong>Article - 11.2. L&rsquo;annulation des commandes par l&rsquo;Universit&eacute; &nbsp;&nbsp;</strong></p>\r\n\r\n<p>En cas d&rsquo;annulation d&rsquo;une commande par l&rsquo;Universit&eacute;, le l&rsquo;adh&eacute;rent est averti dans les meilleurs d&eacute;lais par l&rsquo;Universit&eacute;. Dans le cas d&rsquo;une commande gratuite, l&rsquo;annulation ne donne droit &agrave; aucune indemnit&eacute; de la part de l&rsquo;Universit&eacute;. Dans le cas d&rsquo;une commande payante, un avoir du montant de la commande est valable pour l&rsquo;ann&eacute;e universitaire en cours (de septembre &agrave; juillet. Il est &agrave; faire valoir imm&eacute;diatement apr&egrave;s l&rsquo;annulation aupr&egrave;s d&rsquo;un bureau des sports d&rsquo;UCA Sport. La COMUE UCA se r&eacute;serve la possibilit&eacute; de radier un adh&eacute;rent qui manquerait plus de 3 cr&eacute;neaux encadr&eacute;s cons&eacute;cutifs dans une activit&eacute; sans pr&eacute;venir l&rsquo;Universit&eacute;, sans possibilit&eacute; de d&eacute;dommagement pour l&rsquo;adh&eacute;rent. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 12 Responsabilit&eacute;s de l&rsquo;Universit&eacute; </strong></p>\r\n\r\n<p>Les &eacute;v&eacute;nements et activit&eacute;s propos&eacute;s sont conformes &agrave; la l&eacute;gislation fran&ccedil;aise en vigueur. Les encadrants sont des professionnels dipl&ocirc;m&eacute;s et l&rsquo;&eacute;tablissement est titulaire d&rsquo;une assurance qui couvre l&rsquo;organisation de ces &eacute;v&eacute;nements et activit&eacute;s.&nbsp; Les photos sont communiqu&eacute;es &agrave; titre illustratif. Les adh&eacute;rents sont invit&eacute;s &agrave; se reporter au descriptif de chaque activit&eacute; pour en conna&icirc;tre les caract&eacute;ristiques pr&eacute;cises.&nbsp;</p>\r\n\r\n<p>La COMUE UCA n&rsquo;est responsable que du contenu des pages qu&rsquo;elle &eacute;dite.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 13 Propri&eacute;t&eacute; intellectuelle et la marque de la COMUE UCA </strong></p>\r\n\r\n<p>Tous les &eacute;l&eacute;ments (textes, images, photographies, commentaires, illustrations, &oelig;uvres, sons, etc.) reproduits, repr&eacute;sent&eacute;s ou &eacute;mis sur le site internet &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr) sont la propri&eacute;t&eacute; exclusive de l&rsquo;Universit&eacute;, et sont strictement r&eacute;serv&eacute;s au titre du droit d&#39;auteur ainsi qu&#39;au titre de la propri&eacute;t&eacute; intellectuelle. &nbsp;<br />\r\n&nbsp;<br />\r\nEn cons&eacute;quence, sont strictement interdites toute reproduction ou repr&eacute;sentation, toute utilisation ou mise &agrave; disposition de tiers, totale ou partielle, quel qu&rsquo;en soit le support, du site internet &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr), ou de tout ou partie des &eacute;l&eacute;ments se trouvant sur ce site.<br />\r\n&nbsp;<br />\r\nPersonne n&rsquo;est donc autoris&eacute; &agrave; reproduire, exploiter, rediffuser ou utiliser, &agrave; quelque titre que ce soit, tout ou partie des &eacute;l&eacute;ments du site. &nbsp;<br />\r\n&nbsp;<br />\r\nTout lien simple ou par hypertexte est interdit sans accord pr&eacute;alable de la COMUE UCA (qui peut &ecirc;tre sollicit&eacute; par mail : dvu@univ-cotedazur.fr). &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 14 Protection des donn&eacute;es personnelles</strong></p>\r\n\r\n<p>Des informations et donn&eacute;es nominatives concernant l&rsquo;adh&eacute;rent sont n&eacute;cessaires &agrave; la gestion de sa commande et aux relations commerciales entretenues avec l&rsquo;Universit&eacute;. Elles peuvent faire l&rsquo;objet d&rsquo;un traitement automatis&eacute;, pour l&rsquo;ex&eacute;cution des services et commandes pour leur gestion, ex&eacute;cution, traitement et paiement. &nbsp;<br />\r\n&nbsp;<br />\r\nConform&eacute;ment &agrave; la loi n&deg; 78-17 du 6 janvier 1978, relative &agrave; l&#39;informatique, aux fichiers et aux libert&eacute;s, chaque adh&eacute;rent dispose d&#39;un droit d&#39;acc&egrave;s et de rectification et d&rsquo;opposition aux donn&eacute;es personnelles le concernant. &nbsp;<br />\r\n&nbsp;<br />\r\nL&rsquo;adh&eacute;rent qui le souhaite peut exercer ce droit suivant l&rsquo;un des moyens suivants :<br />\r\n&nbsp;<br />\r\n- L&rsquo;envoi d&rsquo;un courrier &agrave; l&rsquo;adresse suivante :<br />\r\n&nbsp;<br />\r\nDirection de la Vie Universitaire 5 avenue Fran&ccedil;ois Mitterand 06 300 NICE<br />\r\n&nbsp;<br />\r\n- L&rsquo;envoi d&rsquo;un mail, &agrave; l&rsquo;adresse suivante : dvu@univ-cotedazur.fr &nbsp;<br />\r\n&nbsp;<br />\r\nLa demande doit en tout &eacute;tat de cause comporter les nom(s), pr&eacute;nom(s), adresses postale et/ou &eacute;lectronique valide (email) de l&rsquo;adh&eacute;rent. Elle doit &ecirc;tre accompagn&eacute;e de la photocopie d&rsquo;un titre d&rsquo;identit&eacute; portant la signature de l&rsquo;adh&eacute;rent (en fichier PDF si envoi par mail), et pr&eacute;ciser l&rsquo;adresse postale ou &eacute;lectronique &agrave; laquelle doit lui parvenir la r&eacute;ponse. &nbsp;<br />\r\nUne r&eacute;ponse lui sera alors adress&eacute;e par la COMUE UCA dans un d&eacute;lai de 2 mois suivant la r&eacute;ception de la demande.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Article - 15 M&eacute;diation - R&egrave;glement des litiges&nbsp; </strong></p>\r\n\r\n<p>Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont soumises &agrave; la loi fran&ccedil;aise. &nbsp;<br />\r\n&nbsp;<br />\r\nLa langue des pr&eacute;sentes conditions g&eacute;n&eacute;rales est la langue fran&ccedil;aise sur le site fran&ccedil;ais et anglaise pour la version du site traduit en anglais. &nbsp;<br />\r\n&nbsp;<br />\r\nEn cas de litige ou de r&eacute;clamation, l&rsquo;adh&eacute;rent s&rsquo;adresse en priorit&eacute; &agrave; la COMUE UCA en vue de trouver une solution amiable. &nbsp;<br />\r\n&nbsp;<br />\r\nA d&eacute;faut de r&egrave;glement amiable, le litige ou la r&eacute;clamation sera soumis &agrave; une proc&eacute;dure devant le tribunal fran&ccedil;ais comp&eacute;tent, saisi par la partie la plus diligente.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\', 0, \'<p><strong>Article 1 - G&eacute;n&eacute;ralit&eacute;s</strong></p>\r\n\r\n<p>Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont conclues entre :<br />\r\n&nbsp;<br />\r\nD&rsquo;une part, la Communaut&eacute; d&rsquo;Universit&eacute; C&ocirc;te d&rsquo;Azur, &eacute;tablissement public &agrave; caract&egrave;re scientifique, culturel et professionnel, dont le si&egrave;ge social est situ&eacute; &agrave; NICE (06103 &ndash; Cedex 2), Grand Ch&acirc;teau, 28 avenue Valrose, B.P. 2135, &nbsp;<br />\r\n&nbsp;<br />\r\nN&deg; SIREN : 130 020 894&nbsp; N&deg; SIRET : 130 020 894 00015<br />\r\n&nbsp;<br />\r\nCi-apr&egrave;s d&eacute;nomm&eacute;e &laquo; COMUE UCA &raquo;, &nbsp;<br />\r\n&nbsp;<br />\r\nD&rsquo;autre part, toute personne souhaitant proc&eacute;der &agrave; un achat ou une r&eacute;servation sur le site internet &laquo; UCA SPORT &raquo; (adresse : https://sport.univ-cotedazur.fr), &nbsp;<br />\r\n&nbsp;<br />\r\nCi-apr&egrave;s d&eacute;nomm&eacute;e &laquo; l&rsquo;adh&eacute;rent &raquo;.<br />\r\n&nbsp;<br />\r\nTout adh&eacute;rent peut prendre connaissance &agrave; tout moment des conditions g&eacute;n&eacute;rales de vente sur le site.&nbsp;&nbsp; Les pr&eacute;sentes conditions g&eacute;n&eacute;rales r&eacute;gissent la vente de toute prestation de service (activit&eacute;s, &eacute;v&egrave;nements) ou r&eacute;servation de bien (local/installation sportive ou mat&eacute;riel) pr&eacute;sent&eacute;es sur le site de &laquo; UCA SPORT &raquo; (adresse : https://sport.univ-cotedazur.fr).&nbsp; Toute achat d&rsquo;une prestation de service ou r&eacute;servation d&rsquo;un bien par le biais dudit site implique une acceptation sans r&eacute;serve par l&rsquo;adh&eacute;rent des pr&eacute;sentes conditions de vente, et des conditions particuli&egrave;res ou sp&eacute;cifiques &eacute;ventuellement applicables &agrave; une ou plusieurs commandes. La COMUE UCA se r&eacute;serve le droit de modifier les conditions g&eacute;n&eacute;rales de vente &agrave; tout moment.&nbsp; Les conditions de vente applicables sont celles en vigueur sur le site &agrave; la date de la validation de commande (voir l&rsquo;article 9 des pr&eacute;sentes conditions g&eacute;n&eacute;rales). &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 2 - Inscription &nbsp;</strong></p>\r\n\r\n<p>Les &eacute;tudiants et personnels de l&rsquo;&eacute;tablissement, les membres d&rsquo;honneur, les alumnis et les retrait&eacute;s de l&rsquo;&eacute;tablissement, les personnels des &eacute;tablissements partenaires d&eacute;finis sur le site et conformes &agrave; la d&eacute;lib&eacute;ration en vigueur dans l&rsquo;&eacute;tablissement, sont les seules personnes autoris&eacute;es &agrave; r&eacute;aliser des transactions sur le site mobile &laquo; UCA Sport&raquo;.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 3 - Types de services </strong></p>\r\n\r\n<p><strong>Article -3.1. Les caract&eacute;ristiques des services et biens propos&eacute;s &agrave; la vente/r&eacute;servation Les biens et services propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation sont :</strong></p>\r\n\r\n<p>- Le paiement de cotisations sportives pour les membres du personnel ;</p>\r\n\r\n<p>- Des activit&eacute;s physiques et sportives ;&nbsp;</p>\r\n\r\n<p>- Des cartes d&rsquo;activit&eacute;s (tennis, musculation et tennis + musculation) ;</p>\r\n\r\n<p>- Des &eacute;v&egrave;nements ;</p>\r\n\r\n<p>- Des locaux/installations sportives (uniquement en r&eacute;servation)</p>\r\n\r\n<p>- Du mat&eacute;riel sportif (uniquement en r&eacute;servation)&nbsp;</p>\r\n\r\n<p>L&rsquo;ensemble de ces services et biens sont d&eacute;crits et pr&eacute;sent&eacute;s avec la plus grande exactitude possible sur le site de &laquo; UCA Sport &raquo;. Les photos et illustrations sont communiqu&eacute;es au titre de descriptions imag&eacute;es des activit&eacute;s, &eacute;v&eacute;nements, espaces ou mat&eacute;riels &agrave; l&#39;appui du texte n&rsquo;ont aucune valeur contractuelle.<br />\r\n&nbsp;<br />\r\n<strong>Article - 3.2. La disponibilit&eacute; des activit&eacute;s, &eacute;v&eacute;nements, espaces ou mat&eacute;riel propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation </strong></p>\r\n\r\n<p>Les activit&eacute;s, &eacute;v&eacute;nements, locaux ou mat&eacute;riels propos&eacute;s &agrave; la vente ou &agrave; la r&eacute;servation sur le site de &laquo; UCA SPORT &raquo; sont disponibles dans la limite des capacit&eacute;s d&rsquo;accueil, de la disponibilit&eacute; du mat&eacute;riel et des locaux.&nbsp; La disponibilit&eacute; ainsi que les capacit&eacute;s d&rsquo;accueil des biens et services propos&eacute;s &agrave; la vente sont pr&eacute;cis&eacute;es sur le site internet, sur chaque descriptif d&rsquo;activit&eacute;, d&rsquo;&eacute;v&egrave;nement, de local/installation ou de mat&eacute;riel.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>Article 4 - Vente &agrave; distance et droit de r&eacute;tractation</strong></p>\r\n\r\n<p>Aux termes des articles L221-16 du code de la consommation, vous disposer d&rsquo;un droit de r&eacute;tractation applicable &agrave; votre souscription, sans motivation, dans les quatorze (14) jours francs &agrave; compter du jour de l&rsquo;inscription. Si le quatorzi&egrave;me (14e) jour tombe un week-end ou un jour f&eacute;ri&eacute;, le droit de r&eacute;tractation expirera &agrave; la fin du premier jour ouvrable suivant. Ce droit de r&eacute;tractation ne s&rsquo;applique que pour les adh&eacute;rents ayant r&eacute;gl&eacute; leur adh&eacute;sion sur le site internet UCA Sport (adresse : https://sport.univ-cotedazur.fr).&nbsp; Si vous d&eacute;cidez de faire usage de votre droit de r&eacute;tractation et que le service, objet de votre achat, n&rsquo;a pas &eacute;t&eacute; utilis&eacute; pendant cette p&eacute;riode de quatorze (14) jours, le remboursement de la cotisation sera int&eacute;gral. Si des services ont &eacute;t&eacute; utilis&eacute; pendant cette p&eacute;riode de quatorze (14) jours, UCA peut se r&eacute;server la possibilit&eacute; de conserver une partie du montant de l&rsquo;adh&eacute;sion vers&eacute;e au prorata du nombre de fois o&ugrave; les prestations de service auront &eacute;t&eacute; utilis&eacute; (&agrave; savoir &agrave; partir de l&rsquo;activation de l&rsquo;adh&eacute;sion jusqu&rsquo;au jour de l&rsquo;annulation, y compris les &eacute;ventuels frais d&rsquo;inscription). Le montant du remboursement sera effectu&eacute; sur le m&ecirc;me moyen de paiement. UCA s&rsquo;engage &agrave; rembourser l&rsquo;adh&eacute;rent dans un d&eacute;lai d&rsquo;un mois.<br />\r\n&nbsp;<br />\r\nPour vous r&eacute;tracter, vous devez envoyer un message par le biais de l&rsquo;onglet contact situ&eacute; sur le site de &laquo; UCA Sport &raquo; en mentionnant les informations ci-dessous : Je vous notifie par la pr&eacute;sente ma d&eacute;cision de r&eacute;tractation du contrat portant sur la prestation de service suivante :</p>\r\n\r\n<p>Souscris-le :</p>\r\n\r\n<p>Nom du (des) souscripteur(s) :</p>\r\n\r\n<p>Date de naissance du ou (des) souscripteur(s)</p>\r\n\r\n<p>Adresse du (des) souscripteur(s) :</p>\r\n\r\n<p>Date :<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 5 - Attestation/Certificat m&eacute;dical</strong></p>\r\n\r\n<p>Il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de produire un certificat m&eacute;dical arguant d&rsquo;une bonne capacit&eacute; physique. L&rsquo;adh&eacute;rent d&eacute;clare que son &eacute;tat de sant&eacute; lui permet de pratiquer les activit&eacute;s sportives propos&eacute;es par &laquo; UCA Sport &raquo; et plus particuli&egrave;rement d&rsquo;utiliser les services, locaux/installations et mat&eacute;riels sportifs apr&egrave;s avoir pris connaissance des consignes de s&eacute;curit&eacute;, d&rsquo;hygi&egrave;ne et d&rsquo;utilisation. Par ailleurs, l&rsquo;adh&eacute;rent d&eacute;clare qu&rsquo;il ne souffre d&rsquo;aucune maladie cardiaque, respiratoire notamment et/ou d&rsquo;aucune blessure ou inaptitude physique de nature &agrave; l&rsquo;emp&ecirc;cher de pratiquer les activit&eacute;s et services objets des pr&eacute;sentes Conditions G&eacute;n&eacute;rales de Ventes. L&rsquo;adh&eacute;rent sujet aux crises d&rsquo;&eacute;pilepsie ou autres pathologies susceptibles de complexifier l&rsquo;intervention des &eacute;quipes m&eacute;dicales et sauveteurs doit en informer express&eacute;ment &laquo; UCA Sport &raquo;. L&rsquo;adh&eacute;rent d&eacute;clare avoir &eacute;t&eacute; inform&eacute; et conna&icirc;tre les risques li&eacute;s &agrave; la pratique des activit&eacute;s sportives propos&eacute;es.&nbsp; En tout &eacute;tat de cause, &laquo; UCA Sport &raquo; n&rsquo;est pas exon&eacute;r&eacute;e de ses obligations d&rsquo;information et de conseil.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 6 - Tarifs</strong></p>\r\n\r\n<p>Les prix affich&eacute;s sur le site de &laquo; UCA Sport &raquo; sont indiqu&eacute;s en euros (&euro;), toutes taxes comprises (TTC). L&rsquo;COMUE UCAse r&eacute;serve le droit de modifier les prix &agrave; tout moment, &eacute;tant entendu que le tarif, affich&eacute; sur le site internet, le jour de l&rsquo;achat ou de la r&eacute;servation sera le seul applicable a l&rsquo;adh&eacute;rent. La validation de son achat par l&rsquo;adh&eacute;rent vaut acceptation pleine et enti&egrave;re de la tarification appliqu&eacute;e &agrave; l&rsquo;offre concern&eacute;e. Le paiement de la totalit&eacute; du prix doit &ecirc;tre r&eacute;alis&eacute; lors de la commande en ligne du service. L&rsquo;adh&eacute;rent ne pourra jouir des biens ou services propos&eacute;s que lorsque le paiement complet du prix aura &eacute;t&eacute; per&ccedil;u par l&rsquo;Universit&eacute;.<br />\r\n<strong>&nbsp;<br />\r\nArticle 6.1 - L&rsquo;adh&eacute;sion &agrave; &laquo; UCA Sport &raquo;</strong></p>\r\n\r\n<p>Les &eacute;tudiants inscrits en formation initiale dans l&rsquo;enseignement sup&eacute;rieur acquittent pr&eacute;alablement &agrave; leur inscription, la contribution vie &eacute;tudiante et de campus (CVEC) d&rsquo;un montant de 90 &euro;. Les &eacute;tudiants boursiers sont exon&eacute;r&eacute;s de cette contribution. Tous les &eacute;tudiants inscrits en formation initiale ont ainsi acc&egrave;s &agrave; des services de vie &eacute;tudiante dont l&rsquo;offre sportive et ce gratuitement une fois le paiement de la CVEC confirm&eacute;e (pr&eacute;alable &agrave; l&rsquo;inscription dans l&rsquo;&eacute;tablissement). UCA permet &agrave; d&rsquo;autres publics que les &eacute;tudiants en formation initiale d&rsquo;acc&eacute;der &agrave; l&rsquo;offre sportive, selon les modalit&eacute;s d&eacute;crites ci-dessous. Les diff&eacute;rents types d&rsquo;adh&eacute;sion (CVEC, cartes d&rsquo;adh&eacute;sions), permettent l&rsquo;acc&egrave;s &agrave; un bouquet d&rsquo;activit&eacute;s dans la limite des places disponibles, en sports individuels et collectifs comprenant des activit&eacute;s de pleine nature, aquatique, de montagne ou encore de glisse, des sports collectifs en salle et ext&eacute;rieurs organis&eacute;s et encadr&eacute;s par des professionnels.</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>Public</strong></td>\r\n			<td><strong>Type de droit</strong></td>\r\n			<td><strong>Tarif</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td>Etudiants UCA / Villa Arson / ERACM</td>\r\n			<td><br />\r\n			Carte sport</td>\r\n			<td><br />\r\n			(CVEC)</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Personnels UNS / UCA / CIRM / ERACM / Villa Arson</td>\r\n			<td><br />\r\n			Carte sport</td>\r\n			<td>60 &euro;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Membres d&rsquo;honneur*, retrait&eacute;s, alumnis de l&rsquo;&eacute;tablissement et Auditeurs libres</td>\r\n			<td>Carte 3 activit&eacute;s sur liste d&eacute;fini</td>\r\n			<td>150 &euro;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Partenaires</td>\r\n			<td>Public non prioritaires</td>\r\n			<td>105 &euro;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>*Membre d&rsquo;honneur : Personnes dont l&rsquo;&eacute;tablissement reconna&icirc;t le lien particulier avec le service des sports via un vote en Conseil des Sports</p>\r\n\r\n<p>Partenaires : Personnels de l&rsquo;OCA et des EPST partenaires de l&rsquo;UNS (CNRS, INSERM, INRA, INRIA, IRD)</p>\r\n\r\n<p><strong>Article 6.2 - Les activit&eacute;s optionnelles payantes </strong></p>\r\n\r\n<p>&laquo; UCA Sport &raquo; propose &agrave; l&rsquo;ensemble des adh&eacute;rents sans distinction d&rsquo;affiliation des activit&eacute;s optionnels payantes, certaines pouvant faire l&rsquo;objet d&rsquo;un droit de priorit&eacute;s pour les &eacute;tudiants. Ces derni&egrave;res sont nomm&eacute;es et leurs tarifs d&eacute;velopp&eacute;s sur le site et en annexe des pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente.&nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 7 &ndash; La Carte</strong></p>\r\n\r\n<p>La Carte &eacute;tudiante/personnel/autres personnes autoris&eacute;es est une carte d&rsquo;acc&egrave;s que l&rsquo;adh&eacute;rent doit obligatoirement avoir sur lui. Elle est nominative et incessible. Elle est valable pour toute la dur&eacute;e de l&rsquo;adh&eacute;sion, sauf en cas de perte ou d&eacute;t&eacute;rioration, o&ugrave; elle sera remplac&eacute;e aux frais de l&rsquo;adh&eacute;rent. Il est obligatoire de pr&eacute;senter la Carte. En cas de non-pr&eacute;sentation de la Carte, l&rsquo;acc&egrave;s &agrave; l&rsquo;activit&eacute;, &agrave; l&rsquo;&eacute;v&egrave;nement, au local ou au mat&eacute;riel pourra &ecirc;tre refus&eacute;.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 8 - Libre acc&egrave;s aux installations</strong></p>\r\n\r\n<p>Les adh&eacute;rents peuvent sur pr&eacute;sentation de leur carte &eacute;tudiant/personnel/autres personnes autoris&eacute;es, en cours de validit&eacute;, b&eacute;n&eacute;ficier de l&rsquo;acc&egrave;s aux diff&eacute;rentes activit&eacute;s sur l&rsquo;ensemble des campus et b&acirc;timents de UCA. Pour acc&eacute;der aux activit&eacute;s, ils devront avoir proc&eacute;der &agrave; la r&eacute;servation, sur le site internet, d&eacute;crite dans l&rsquo;article ci-apr&egrave;s. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article 9 - Modalit&eacute;s d&rsquo;inscription</strong></p>\r\n\r\n<p><strong>Article - 9.1. La commande</strong></p>\r\n\r\n<p>La commande est l&rsquo;ensemble des actes r&eacute;alis&eacute;s de s&eacute;lection, de validation du panier et de paiement, mis en &oelig;uvre par tout adh&eacute;rent, pour un usage exclusivement personnel sur le site internet.<br />\r\n&nbsp;<br />\r\n<strong>Article - 9.1.1. Les modalit&eacute;s de passation de la commande</strong></p>\r\n\r\n<p>Il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de passer commande aupr&egrave;s de la COMUE UCA en ligne sur le site internet ou via l&rsquo;application &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr). En cas d&rsquo;impossibilit&eacute; il est &eacute;galement possible de payer en esp&egrave;ces ou par ch&egrave;que aupr&egrave;s d&rsquo;un bureau des sports. Aucune commande adress&eacute;e &agrave; la COMUE UCA par courrier ou par fax ne sera prise en compte.&nbsp; L&rsquo;adh&eacute;rent int&eacute;ress&eacute; par une activit&eacute;, un &eacute;v&eacute;nement, un local/installation sportive ou du mat&eacute;riel sportif visible sur le site &laquo; UCA Sport &raquo; suit le processus suivant afin d&#39;&eacute;tablir sa commande.</p>\r\n\r\n<p>PREMIERE ETAPE :&nbsp;</p>\r\n\r\n<p>Toute commande aupr&egrave;s de la COMUE UCA n&eacute;cessite d&rsquo;abord la cr&eacute;ation d&rsquo;un Compte d&rsquo;Adh&eacute;rent sur le site d&rsquo;&laquo;UCA Sport &raquo;.&nbsp; L&rsquo;acc&egrave;s &agrave; ce Compte Adh&eacute;rent est autoris&eacute; :<br />\r\n&nbsp;<br />\r\n- Soit par le statut d&rsquo;adh&eacute;rent (&eacute;tudiants, personnels, personnels des &eacute;tablissements partenaires, et accessible directement via les identifiants de connexion de l&rsquo;&eacute;tablissement de rattachement),&nbsp; - Soit par la demande de cr&eacute;ation d&rsquo;un compte aupr&egrave;s des administrateurs &laquo; UCA Sport &raquo; qui sera ou non valid&eacute;e de mani&egrave;re discr&eacute;tionnaire pour les alumnis, les retrait&eacute;s de l&rsquo;&eacute;tablissement et les membres d&rsquo;honneur*. *voir article 6.1<br />\r\n&nbsp;<br />\r\nL&rsquo;adh&eacute;rent s&rsquo;engage &agrave; ne pas communiquer les identifiants de son Compte &agrave; des tiers. La COMUE UCA ne saurait &ecirc;tre tenue pour responsable de toute action r&eacute;alis&eacute;e via ou sur un Compte Adh&eacute;rent par un tiers auquel l&rsquo;adh&eacute;rent aurait communiqu&eacute; ses identifiants, ou bien qui aurait eu acc&egrave;s aux identifiants ou au Compte Adh&eacute;rent suite &agrave; une faute ou une n&eacute;gligence imputable audit adh&eacute;rent.</p>\r\n\r\n<p>DEUXIEME ETAPE :</p>\r\n\r\n<p>Apr&egrave;s avoir s&eacute;lectionn&eacute; un panier de commande, l&rsquo;adh&eacute;rent doit contr&ocirc;ler (par exemple : identification et quantit&eacute; d&rsquo;activit&eacute;s s&eacute;lectionn&eacute;es, prix correspondants) et &eacute;ventuellement corriger le contenu du panier, avant de le valider.</p>\r\n\r\n<p>TROISIEME ETAPE :&nbsp;</p>\r\n\r\n<p>L&rsquo;adh&eacute;rent doit effectuer le paiement dans les conditions pr&eacute;vues aux pr&eacute;sentes conditions g&eacute;n&eacute;rales.</p>\r\n\r\n<p><strong>Article - 9.1.2. L&rsquo;enregistrement de la commande </strong></p>\r\n\r\n<p>Suite au paiement de la commande, la COMUE UCA accuse r&eacute;ception aupr&egrave;s de l&rsquo;adh&eacute;rent de l&rsquo;acceptation du paiement, en lui mettant &agrave; disposition une facture contenant les r&eacute;f&eacute;rences de la commande ainsi que le r&eacute;capitulatif d&eacute;taill&eacute; (num&eacute;ro, date, mode de paiement, activit&eacute;s achet&eacute;es) dans les param&egrave;tres de son compte adh&eacute;rent.</p>\r\n\r\n<p><strong>Article - 9.2. Dispositions g&eacute;n&eacute;rales&nbsp;</strong></p>\r\n\r\n<p>L&rsquo;ensemble des donn&eacute;es fournies et la commande enregistr&eacute;e valent preuve de la transaction. La confirmation vaut signature et acceptation de la commande par le l&rsquo;adh&eacute;rent. La validation de la commande vaut, dans tous les cas, signature et acceptation de toutes les op&eacute;rations effectu&eacute;es sur le site.</p>\r\n\r\n<p>&nbsp;<br />\r\n<strong>Article - 10 Modalit&eacute;s de paiement </strong></p>\r\n\r\n<p><strong>Article - 10.1. Le paiement de la commande</strong></p>\r\n\r\n<p>Le paiement des commandes individuelles s&rsquo;effectue &agrave; chaque fois que cela est possible en ligne &agrave; partir du site internet &laquo; UCA Sport &raquo;, par carte bancaire. En cas d&rsquo;impossibilit&eacute;, le paiement en bureau des sports est possible en ch&egrave;que ou esp&egrave;ces. L&rsquo;adh&eacute;rent fournit les donn&eacute;es confidentielles li&eacute;es &agrave; son moyen de paiement (num&eacute;ro de carte bancaire, date d&rsquo;expiration et cryptogramme). Il valide finalement sa commande en cliquant sur le bouton &quot;Valider&quot;. Cette validation vaut vente et engage irr&eacute;vocablement les parties.<br />\r\n&nbsp;<br />\r\n<strong>Article - 10.2. La s&eacute;curisation des paiements</strong></p>\r\n\r\n<p>Les paiements effectu&eacute;s &agrave; partir du site internet &laquo; UCA Sport &raquo; sont enti&egrave;rement s&eacute;curis&eacute;s. La COMUE UCA recourt &agrave; la plateforme de paiement s&eacute;curis&eacute; Paybox&reg;, qui garantit l&rsquo;utilisation du proc&eacute;d&eacute; de cryptage SSL (Secure Socket Layer) pour prot&eacute;ger toutes les donn&eacute;es confidentielles li&eacute;es aux moyens de paiement (num&eacute;ro de carte bancaire, date d&rsquo;expiration et cryptogramme), communiqu&eacute;es par l&rsquo;adh&eacute;rent lors de sa commande.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 11 Annulation de l&rsquo;inscription&nbsp; </strong></p>\r\n\r\n<p><strong>Article - 11.1. L&rsquo;annulation des commandes par l&rsquo;adh&eacute;rent </strong></p>\r\n\r\n<p>L&rsquo;annulation des commandes par l&rsquo;adh&eacute;rent se fait en se d&eacute;sinscrivant de l&rsquo;activit&eacute; via le site.&nbsp; Dans le cas d&rsquo;activit&eacute;s ou d&rsquo;&eacute;v&eacute;nements payants, il est demand&eacute; &agrave; l&rsquo;adh&eacute;rent de pr&eacute;venir l&rsquo;encadrant de l&rsquo;activit&eacute; ou de l&rsquo;&eacute;v&eacute;nement par mail dans les meilleurs d&eacute;lais. L&rsquo;adh&eacute;rent s&rsquo;assure de remplir tous les crit&egrave;res pour participer &agrave; une activit&eacute; avant son paiement. Aucune annulation du fait du de l&rsquo;adh&eacute;rent ne donne droit &agrave; un quelconque remboursement de la part de l&rsquo;Universit&eacute;.&nbsp;&nbsp; Article - 11.2. L&rsquo;annulation des commandes par l&rsquo;Universit&eacute;.&nbsp;&nbsp; En cas d&rsquo;annulation d&rsquo;une commande par l&rsquo;Universit&eacute;, le l&rsquo;adh&eacute;rent est averti dans les meilleurs d&eacute;lais par l&rsquo;Universit&eacute;. Dans le cas d&rsquo;une commande gratuite, l&rsquo;annulation ne donne droit &agrave; aucune indemnit&eacute; de la part de l&rsquo;Universit&eacute;. Dans le cas d&rsquo;une commande payante, un avoir du montant de la commande est valable pour l&rsquo;ann&eacute;e universitaire en cours (de septembre &agrave; juillet. Il est &agrave; faire valoir imm&eacute;diatement apr&egrave;s l&rsquo;annulation aupr&egrave;s d&rsquo;un bureau des sports d&rsquo;UCA Sport. La COMUE UCA se r&eacute;serve la possibilit&eacute; de radier un adh&eacute;rent qui manquerait plus de 3 cr&eacute;neaux encadr&eacute;s cons&eacute;cutifs dans une activit&eacute; sans pr&eacute;venir l&rsquo;Universit&eacute;, sans possibilit&eacute; de d&eacute;dommagement pour l&rsquo;adh&eacute;rent. &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 12 Responsabilit&eacute;s de l&rsquo;Universit&eacute; </strong></p>\r\n\r\n<p>Les &eacute;v&eacute;nements et activit&eacute;s propos&eacute;s sont conformes &agrave; la l&eacute;gislation fran&ccedil;aise en vigueur. Les encadrants sont des professionnels dipl&ocirc;m&eacute;s et l&rsquo;&eacute;tablissement est titulaire d&rsquo;une assurance qui couvre l&rsquo;organisation de ces &eacute;v&eacute;nements et activit&eacute;s.&nbsp; Les photos sont communiqu&eacute;es &agrave; titre illustratif. Les adh&eacute;rents sont invit&eacute;s &agrave; se reporter au descriptif de chaque activit&eacute; pour en conna&icirc;tre les caract&eacute;ristiques pr&eacute;cises.&nbsp;</p>\r\n\r\n<p>La COMUE UCA n&rsquo;est responsable que du contenu des pages qu&rsquo;elle &eacute;dite.<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 13 Propri&eacute;t&eacute; intellectuelle et la marque de la COMUE UCA </strong></p>\r\n\r\n<p>Tous les &eacute;l&eacute;ments (textes, images, photographies, commentaires, illustrations, &oelig;uvres, sons, etc.) reproduits, repr&eacute;sent&eacute;s ou &eacute;mis sur le site internet &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr) sont la propri&eacute;t&eacute; exclusive de l&rsquo;Universit&eacute;, et sont strictement r&eacute;serv&eacute;s au titre du droit d&#39;auteur ainsi qu&#39;au titre de la propri&eacute;t&eacute; intellectuelle. &nbsp;<br />\r\n&nbsp;<br />\r\nEn cons&eacute;quence, sont strictement interdites toute reproduction ou repr&eacute;sentation, toute utilisation ou mise &agrave; disposition de tiers, totale ou partielle, quel qu&rsquo;en soit le support, du site internet &laquo; UCA Sport &raquo; (adresse : https://sport.univ-cotedazur.fr), ou de tout ou partie des &eacute;l&eacute;ments se trouvant sur ce site.<br />\r\n&nbsp;<br />\r\nPersonne n&rsquo;est donc autoris&eacute; &agrave; reproduire, exploiter, rediffuser ou utiliser, &agrave; quelque titre que ce soit, tout ou partie des &eacute;l&eacute;ments du site. &nbsp;<br />\r\n&nbsp;<br />\r\nTout lien simple ou par hypertexte est interdit sans accord pr&eacute;alable de la COMUE UCA (qui peut &ecirc;tre sollicit&eacute; par mail : dvu@univ-cotedazur.fr). &nbsp;<br />\r\n&nbsp;</p>\r\n\r\n<p><br />\r\n<strong>Article - 14 Protection des donn&eacute;es personnelles</strong></p>\r\n\r\n<p>Des informations et donn&eacute;es nominatives concernant l&rsquo;adh&eacute;rent sont n&eacute;cessaires &agrave; la gestion de sa commande et aux relations commerciales entretenues avec l&rsquo;Universit&eacute;. Elles peuvent faire l&rsquo;objet d&rsquo;un traitement automatis&eacute;, pour l&rsquo;ex&eacute;cution des services et commandes pour leur gestion, ex&eacute;cution, traitement et paiement. &nbsp;<br />\r\n&nbsp;<br />\r\nConform&eacute;ment &agrave; la loi n&deg; 78-17 du 6 janvier 1978, relative &agrave; l&#39;informatique, aux fichiers et aux libert&eacute;s, chaque adh&eacute;rent dispose d&#39;un droit d&#39;acc&egrave;s et de rectification et d&rsquo;opposition aux donn&eacute;es personnelles le concernant. &nbsp;<br />\r\n&nbsp;<br />\r\nL&rsquo;adh&eacute;rent qui le souhaite peut exercer ce droit suivant l&rsquo;un des moyens suivants :<br />\r\n&nbsp;<br />\r\n- L&rsquo;envoi d&rsquo;un courrier &agrave; l&rsquo;adresse suivante :<br />\r\n&nbsp;<br />\r\nDirection de la Vie Universitaire 5 avenue Fran&ccedil;ois Mitterand 06 300 NICE<br />\r\n&nbsp;<br />\r\n- L&rsquo;envoi d&rsquo;un mail, &agrave; l&rsquo;adresse suivante : dvu@univ-cotedazur.fr &nbsp;<br />\r\n&nbsp;<br />\r\nLa demande doit en tout &eacute;tat de cause comporter les nom(s), pr&eacute;nom(s), adresses postale et/ou &eacute;lectronique valide (email) de l&rsquo;adh&eacute;rent. Elle doit &ecirc;tre accompagn&eacute;e de la photocopie d&rsquo;un titre d&rsquo;identit&eacute; portant la signature de l&rsquo;adh&eacute;rent (en fichier PDF si envoi par mail), et pr&eacute;ciser l&rsquo;adresse postale ou &eacute;lectronique &agrave; laquelle doit lui parvenir la r&eacute;ponse. &nbsp;<br />\r\nUne r&eacute;ponse lui sera alors adress&eacute;e par la COMUE UCA dans un d&eacute;lai de 2 mois suivant la r&eacute;ception de la demande.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Article - 15 M&eacute;diation - R&egrave;glement des litiges&nbsp; </strong></p>\r\n\r\n<p>Les pr&eacute;sentes conditions g&eacute;n&eacute;rales de vente sont soumises &agrave; la loi fran&ccedil;aise. &nbsp;<br />\r\n&nbsp;<br />\r\nLa langue des pr&eacute;sentes conditions g&eacute;n&eacute;rales est la langue fran&ccedil;aise sur le site fran&ccedil;ais et anglaise pour la version du site traduit en anglais. &nbsp;<br />\r\n&nbsp;<br />\r\nEn cas de litige ou de r&eacute;clamation, l&rsquo;adh&eacute;rent s&rsquo;adresse en priorit&eacute; &agrave; la COMUE UCA en vue de trouver une solution amiable. &nbsp;<br />\r\n&nbsp;<br />\r\nA d&eacute;faut de r&egrave;glement amiable, le litige ou la r&eacute;clamation sera soumis &agrave; une proc&eacute;dure devant le tribunal fran&ccedil;ais comp&eacute;tent, saisi par la partie la plus diligente.<br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\')');
        $this->addSql('INSERT INTO texte (id, emplacement, titre, texte, mobile, texte_mobile) VALUES (21, \'Infos pratiques - Introduction\', \'\', NULL, 0, NULL)');
